/// @brief Get mnemonic string
/// @param mnemonic Mnemonic value
/// @param uppercase If true, return uppercase version
/// @return Mnemonic string
inline constexpr std::string_view get_mnemonic_string( Mnemonic mnemonic, bool uppercase = false ) noexcept {
	auto idx = static_cast<std::size_t>( mnemonic );
	if ( idx >= MNEMONIC_STRINGS_LOWER.size() ) {
		return "???";
	}
	return uppercase ? MNEMONIC_STRINGS_UPPER[idx] : MNEMONIC_STRINGS_LOWER[idx];
}

